import React from "react";
import Icon from "@mdi/react";
import { mdiAccount } from "@mdi/js";

export function SerialNumber() {
  const style = {
    borderBottom: "#495057"
  };
  return (
    <div className="form-group row">
      <label className="col-sm-2 col-form-label text-secondary font-weight-bold">
        Serial Number
      </label>
      <div className="col-sm-10">
        <div className="input-group-prepend">
          <span className="input-group-text input-group-text-custom rounded-0">
            <Icon path={mdiAccount} size={0.75} className="myIcon">
              ::before
            </Icon>
          </span>
          <input
            type="serialNumber"
            className="form-control border border-top-0 border-right-0"
            id="serialNumber"
            placeholder="Serial Number"
            style={style}
          />
        </div>
      </div>
    </div>
  );
}
